	 (364,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',NULL,0,'Documento_Publico',NULL,0,'Documento pblico','Documento pblico es el otorgado por el funcionario pblico en ejercicio de sus funciones o con su intervencin. As mismo, es pblico el documento otorgado por un particular en ejercicio de funciones pblicas o con su intervencin. Cuando consiste en un escrito autorizado o suscrito por el respectivo funcionario, es instrumento pblico; cuando es autorizado por un notario o quien haga sus veces y ha sido incorporado en el respectivo protocolo, se denomina escritura pblica.'),
	 (365,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',NULL,1,'Documento_Privado',NULL,0,'Documento privado','El documento privado es aquel documento que no cumple los requisitos del documento pblico, es decir, es un documento que no ha sido elaborado por un funcionario pblico, ni ha habido intervencin de ste para su elaboracin.'),
	 (547,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FuenteAdministrativaTipo','LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',0,'Documento_Publico.Escritura_Publica',NULL,0,'(Documento pblico) Escritura pblica','Una escritura pblica es un documento pblico en el que se realiza ante un notario pblico un determinado hecho o un derecho autorizado por dicho fedatario pblico, que firma con el otorgante u otorgantes,mostrando sobre la capacidad jurdica del contenido y de la fecha en que se realiz'),
	 (548,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FuenteAdministrativaTipo','LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',1,'Documento_Publico.Sentencia_Judicial',NULL,0,'(Documento pblico) Sentencia judicial','La sentencia es la resolucin judicial definitiva dictada por un juez o tribunal que pone fin a la litis o caso sometido a su conocimiento y cierra definitivamente su actuacin en el mismo'),
	 (549,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FuenteAdministrativaTipo','LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',2,'Documento_Publico.Acto_Administrativo',NULL,0,'(Documento pblico) Acto administrativo','Un acto administrativo es toda manifestacin o declaracin emanada de la administracin pblica en el ejercicio de potestades administrativas, mediante el que impone su voluntad sobre los derechos, libertades o intereses de otros sujetos pblicos o privados y que queda bajo el del comienzo.'),
	 (550,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FuenteAdministrativaTipo','LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',3,'Documento_Privado.Documento_Privado',NULL,0,'(Documento privado) Documento privado','Documento que contiene un compromiso entre dos o ms personas que lo firman.'),
	 (551,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FuenteAdministrativaTipo','LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',4,'Documento_Privado.Sin_Documento',NULL,0,'(Documento privado) Sin documento','Cuando no se haya documento soporte pero puede ser una declaracin verbal.');INSERT INTO test_ladm_col_queries.col_fuenteespacialtipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
