	 (127,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteEspacialTipo',NULL,1,'Datos_Crudos',NULL,0,'Datos crudos (GPS, Estacin total, LiDAR, etc.)','Datos tomados por un equipo GNSS sin ningn tipo de postprocesamiento.'),
	 (128,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteEspacialTipo',NULL,2,'Ortofoto',NULL,0,'Ortofoto','Imagen producto de la toma de fotografas areas o satlites, en la cual han sido corregidos los desplazamientos causados por la inclinacin de la cmara o sensor y la curvatura de la superficie del terreno. Est referida a un sistema de proyeccin cartogrfica, por lo que posee las caractersticas geomtricas de un mapa con el factor adicional de que los objetos se encuentran representados de forma real en la imagen de la fotogrfica.'),
