	 (331,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',3,'Predio.Publico.Uso_Publico',NULL,0,'(Predio) (Pblico) Uso pblico','Son aquellos inmuebles de dominio pblico cuyo uso pertenece a todos los habitantes del territorio nacional, destinados al uso o disfrute colectivo.'),
	 (332,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',4,'Predio.Privado',NULL,0,'(Predio) (Privado)','Es aquel que ha salido del patrimonio del estado, cuenta con un propietario inscrito en el folio de matrcula y se considera propiedad privada en los trminos del artculo 48 de la Ley 160 de 1993.'),
	 (333,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',5,'Predio.Territorio_Colectivo',NULL,0,'(Predio) (Territorio colectivo)','Son los predios adjudicados a comunidades pertenecientes a grupos tnicos en el marco del reconocimiento de los resguardos legalmente constituidos segn el Decreto 2164 de 1995 o de las propiedades colectivas de comunidades negras conforme Ley 70 de 1993.'),
	 (334,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',6,'Predio.Vacante',NULL,0,'(Predio) (Vacante)','Son bienes inmuebles que se encuentran dentro de territorio respectivo a cargo de la Nacin, sin dueo aparente o conocido'),
