	 (450,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,65,'Via_Ferrea.Tipo_80',NULL,0,'(Anexo) (Va frrea) Tipo 80','Via frrea de trocha  normal o estndar (4 pies, 8 1/2 pulgadas o 1435 metros) con capacidad de transporte mayor a 50 toneladas, conformada por una capa de balasto, sobre la cual se disponen traviesas de madera que soportan los rieles, entindase como trocha a la distancia mnima entre los dos rieles.'),
