	 (452,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,67,'Carreteras.Tipo_60',NULL,0,'(Anexo) (Carreteras) Tipo 60','Carretera pavimentada. Compuesta de una subbase granular, base en suelo cemento y carpeta asfltica, entindase por sub-base granular como la capa de material granular situada entre la base del firme y la explanada.'),
