	 (455,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,70,'Cimientos_Estructura_Muros_Placabase.Tipo_60',NULL,0,'(Anexo) (Cimientos estructura muros placabase) Tipo 60','Cimentacin y estructura con soportes verticales (columnas) y horizontales (vigas) destinados a sostener la totalidad o parte de la futura construccin o edificacin, acompaados de muros o placas base. Esta tipologa se caracteriza por presentar de manera simultnea 3 elementos (Cimientos, Estructura, y alguno de estos dos elementos Muro Pared o Losa en Contra piso)'),
	 (456,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,71,'Cimientos_Estructura_Muros_Placabase.Tipo_40',NULL,0,'(Anexo) (Cimientos estructura muros placabase) Tipo 40','Cimentacin sin estructura destinada a sostener la totalidad o parte de una futura construccin o edificacin, pueden estar acompaados de muros o placas base. Esta tipologa se caracteriza por presentar de manera simultnea 2 elementos (Cimientos y alguno de estos dos elemetnos Muro - Pared o Losa de Contra piso)'),
