	 (503,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CategoriaSueloTipo',NULL,0,'Suburbano',NULL,0,'Suburbano','Constituyen esta categora las reas ubicadas dentro del suelo rural, en las que se mezclan los usos del suelo y las formas de vida del campo y la ciudad, diferentes a las clasificadas como reas de expansin urbana, que pueden ser objeto de desarrollo con restricciones de uso, de intensidad y de densidad, garantizando el autoabastecimiento en servicios pblicos domiciliarios, de conformidad con lo establecido en la Ley 99 de 1993 y en la Ley 142 de 1994. Podrn formar parte de esta categora los suelos correspondientes a los corredores urbanos interregionales.

Los municipios y distritos debern establecer las regulaciones complementarias tendientes a impedir el desarrollo de actividades y usos urbanos en estas reas, sin que previamente se surta el proceso de incorporacin al suelo urbano, para lo cual debern contar con la infraestructura de espacio pblico, de infraestructura vial y redes de energa, acueducto y alcantarillado requerida para este tipo de suelo. (Artculo 34, Ley 388 de 1997)'),
	 (504,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CategoriaSueloTipo',NULL,1,'Proteccion',NULL,0,'Proteccin','Constituido por las zonas y reas de terrenos localizados dentro de cualquiera de las anteriores clases, que por sus caractersticas geogrficas, paisajsticas o ambientales, o por formar parte de las zonas de utilidad pblica para la ubicacin de infraestructuras para la provisin de servicios pblicos domiciliarios o de las reas de amenazas y riesgo no mitigable para la localizacin de asentamientos humanos, tiene restringida la posibilidad de urbanizarse. (Articulo 35, Ley 388 de 1997)');INSERT INTO test_ladm_col_queries.lc_clasecalificaciontipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (481,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseCalificacionTipo',NULL,0,'Estructura',NULL,0,'Estructura','En construccin, es el nombre que recibe el conjunto de elementos, unidos, ensamblados o conectados entre s, que tienen la funcin de recibir cargas, soportar esfuerzos y transmitir esas cargas al suelo, garantizando as la funcin esttico - resistente de la construccin. Sus componentes son: armazn, muros y cubierta.'),
	 (482,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseCalificacionTipo',NULL,1,'Acabados_Principales',NULL,0,'Acabados principales','Son los revestimientos o recubrimientos a todos aquellos materiales que se colocan sobre una superficie de obra negra, para darle terminacin a las obras, quedando sta con un aspecto habitable. Sus componentes son: fachada, cubrimiento de muros y pisos.'),
	 (483,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseCalificacionTipo',NULL,2,'Banio',NULL,0,'Bao','Espacio o lugar especialmente equipado para el aseo personal. Sus componentes son: tamao, enchapes y mobiliario.'),
	 (484,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseCalificacionTipo',NULL,3,'Cocina',NULL,0,'Cocina','Espacio o lugar especialmente equipado para la preparacin de alimentos. Sus componentes son: tamao, enchapes y mobiliario.'),
	 (485,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseCalificacionTipo',NULL,4,'Complemento_Industria',NULL,0,'Complemento industria','Elemento adicional para la calificacin de las Cerchas para las construcciones industriales.');INSERT INTO test_ladm_col_queries.lc_clasesuelotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (286,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseSueloTipo',NULL,0,'Urbano',NULL,0,'Urbano','Constituyen el suelo urbano, las reas del territorio distrital o municipal destinadas a usos urbanos por el plan de ordenamiento, que cuenten con infraestructura vial y redes primarias de energa, acueducto y alcantarillado, posibilitndose su urbanizacin y edificacin, segn sea el caso. Podrn pertenecer a esta categora aquellas zonas con procesos de urbanizacin incompletos, comprendidos en reas consolidadas con edificacin, que se definan como reas de mejoramiento integral en los planes de ordenamiento territorial.

Las reas que conforman el suelo urbano sern delimitadas por permetros y podrn incluir los centros poblados de los corregimientos. En ningn caso el permetro urbano podr ser mayor que el denominado permetro de servicios pblicos o sanitario. (Artculo 31, Ley 388 de 1997)'),
	 (287,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseSueloTipo',NULL,1,'Rural',NULL,0,'Rural','Constituyen esta categora los terrenos no aptos para el uso urbano, por razones de oportunidad, o por su destinacin a usos agrcolas, ganaderos, forestales, de explotacin de recursos naturales y actividades anlogas. (Artculo 33, Ley 388 de 1997)'),
	 (288,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseSueloTipo',NULL,2,'Expansion_Urbana',NULL,0,'Expansin urbana','Constituido por la porcin del territorio municipal destinada a la expansin urbana, que se habilitar para el uso urbano durante la vigencia del plan de ordenamiento, segn lo determinen los Programas de Ejecucin.

La determinacin de este suelo se ajustar a las previsiones de crecimiento de la ciudad y a la posibilidad de dotacin con infraestructura para el sistema vial, de transporte, de servicios pblicos domiciliarios, reas libres, y parques y equipamiento colectivo de inters pblico o social.

Dentro de la categora de suelo de expansin podrn incluirse reas de desarrollo concertado, a travs de procesos que definan la conveniencia y las condiciones para su desarrollo mediante su adecuacin y habilitacin urbanstica a cargo de sus propietarios, pero cuyo desarrollo estar condicionado a la adecuacin previa de las reas programadas. (Artculo 32, Ley 388 de 1997)');INSERT INTO test_ladm_col_queries.lc_condicionprediotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
