	 (486,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DerechoTipo',NULL,0,'Dominio',NULL,0,'Dominio','El dominio que se llama tambin propiedad es el derecho real en una cosa corporal, para gozar y disponer de ella arbitrariamente, no siendo contra ley o contra derecho ajeno. (Art. 669 CC): 0100 0101 0102 0103 0106 0107 0108 0109 0110 0111 0112 0113 0114 0115 0116 0117 0118 0119 0120 0121 0122 0124 0125 0126 0127 0128 0129 0130 0131 0132 0133 0135 0137 0138 0139 0140 0141 0142 0143 0144 0145 0146 0147 0148 0150 0151 0152 0153 0154 0155 0156 0157 0158 0159 0160 0161 0163 0164 0165 0166 0167 0168 0169 0171 0172 0173 0175 0177 0178 0179 0180 0181 0182 0183 0184 0185 0186 0187 0188 0189 0190 0191 0192 0193 0194 0195 0196 0197 0198 0199 01003 01004 01005 01006 01007 01008 01009 01010 01012 01013 01014 0301 0307 0321 0332 0348 0356 0374 0375 0376 0377 0906 0907 0910 0911 0912 0913 0915 0917 0918 0919 0920 0924 0935 0959 0962 0963'),
	 (487,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DerechoTipo',NULL,1,'Ocupacion',NULL,0,'Ocupacin','En el mbito de la gestin catastral, es el polgono que representa el asentamiento de personas naturales o jurdicas dentro de un terreno baldo, el cual puede contar o no con construcciones y/o edificaciones.'),
	 (488,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DerechoTipo',NULL,2,'Posesion',NULL,0,'Posesin','En el mbito de la gestin catastral, es el polgono que representa el asentamiento de personas naturales o jurdicas, con nimo de seor y dueo sobre un predio privado, el cual puede contar o no con construcciones y/o edificaciones.');INSERT INTO test_ladm_col_queries.lc_destinacioneconomicatipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (514,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,0,'Acuicola',NULL,0,'Acuicola','Se califica con destino acucola, aquellos predios donde se realizan cultivos de organismos acuticos, en ambientes naturales o artificiales.'),
	 (515,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,1,'Agricola',NULL,0,'Agrcola','Se califica con destino agrcola, aquellos predios con funcionalidad de laboreo agrcola, terrenos que han sido transformados y ocupados para la produccin de cultivos cuyo objetivo es satisfacer las necesidades alimentarias, comerciales y agrcolas.

En caso de encontrar actividad agrcola y actividad pecuaria en un mismo predio, se califica segn la actividad que predomine. Si, ambas actividades tienen el mismo porcentaje de participacin en el predio, se debe calificar como agrcola.'),
	 (516,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,2,'Agroindustrial',NULL,0,'Agroindustrial','Se califica con destino agroindustrial, aquellos predios destinados a la actividad que implica cultivo (produccin) y transformacin (industrializacin y comercializacin) de productos agrcola, pecuario y forestal.'),
	 (517,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,3,'Agroforestal',NULL,0,'Agroforestal','Se califica con destino agroforestal, aquellos predios destinados al establecimiento y aprovechamiento combinado de especies forestales con actividades agrcolas o pecuarias con arreglos diferenciados. Incluye la actividad agrosilvcola, silvopastoril y agrosilvopastoril.'),
	 (518,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,4,'Comercial',NULL,0,'Comercial','Se califica con destino comercial, aquellos predios cuya finalidad es la de realizar la actividad econmica de ofrecer, transar o almacenar bienes y/o servicios a travs de un mercader o comerciante.'),
	 (519,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,5,'Cultural',NULL,0,'Cultural','Se califica con destino cultural, aquellos predios considerados como bienes culturales de la nacin, adems los espacios destinados al desarrollo de actividades artsticas.'),
	 (520,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,6,'Educativo',NULL,0,'Educativo','Se califica con destino educativo, aquellos predios donde se desarrollan actividades acadmicas, tanto de la educacin inicial, preescolar, bsica, media y superior. Incluye los jardines, escuelas, colegios, institutos tcnicos, fundaciones educativas, centros de investigacin y universidades.'),
	 (521,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,7,'Forestal',NULL,0,'Forestal','Se califica con destino forestal, aquellos predios con reas naturales o seminaturales, constituidas principalmente por elementos arbreos de especies nativas, exticas e introducidas.  Incluye las plantaciones forestales comerciales y los bosques naturales y seminaturales.'),
	 (522,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,8,'Habitacional',NULL,0,'Habitacional','Se califica con destino habitacional, aquellos predios de uso residencial cuya finalidad es la vivienda habitual de las personas. Incluye los parqueaderos, garajes y depsitos dentro de propiedad horizontal como tambin los predios rurales de vivienda campestre.'),
	 (523,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,9,'Industrial',NULL,0,'Industrial','Se califica con destino industrial, aquellos predios donde se desarrollan actividades de produccin, fabricacin, preparacin, recuperacin, reproduccin, ensamblaje, construccin, transformacin, tratamiento y manipulacin de materias primas para producir bienes o productos materiales y que no estn clasificados dentro de los predios mineros.');
INSERT INTO test_ladm_col_queries.lc_destinacioneconomicatipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (524,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,10,'Infraestructura_Asociada_Produccion_Agropecuaria',NULL,0,'Infraestructura asociada a produccin agropecuaria','Se califica con destino infraestructura asociada a la produccin agropecuaria, aquellos predios sobre los cuales se encuentra la infraestructura requerida dentro de la actividad agropecuaria y que son de inters para el sector agropecuario, como: bancos de maquinaria, plantas de almacenamiento, centros de acopio, centros de transformacin agrcola, mataderos, etc.'),
	 (525,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,11,'Infraestructura_Hidraulica',NULL,0,'Infraestructura hidrulica','Se califica con destino infraestructura hidrulica, aquellos predios sobre los cuales se encuentra establecida infraestructura para controlar, almacenar y conducir un flujo continuo de agua. Incluye los embalses, represas, acueductos, centrales de tratamiento y distribucin, alcantarillados, estaciones depuradoras de aguas residenciales y distrito de adecuacin de tierras.'),
	 (526,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,12,'Infraestructura_Saneamiento_Basico',NULL,0,'Infraestructura saneamiento','Se califica con destino infraestructura de saneamiento bsico, aquellos predios sobre los cuales se encuentra establecida la infraestructura para el saneamiento bsico, con excepcin del alcantarillado. Incluye los centros de acopio de basura y material reciclable, rellenos sanitarios e incineradoras.'),
	 (527,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,13,'Infraestructura_Seguridad',NULL,0,'Infraestructura seguridad','Se califica con destino infraestructura de seguridad, aquellos predios sobre los cuales se encuentra establecida infraestructura destina a salvaguardar el orden pblico. Incluye las estaciones de polica, batallones, crceles, etc.'),
	 (528,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,14,'Infraestructura_Transporte',NULL,0,'Infraestructura transporte','Se califica con destino infraestructura de transporte, aquellos predios en los cuales se encuentra establecida infraestructura para el desarrollo de actividad de transporte, muelles para embarque, desembarque de carga y/o pasajeros, pistas de aterrizaje, torres de control, centros de almacenamiento y venta de combustible, etc. Se exceptan de estas, aquellas plataformas flotantes y aquellas que se encuentren fuera de la plataforma continental.'),
	 (529,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,15,'Institucional',NULL,0,'Institucional','Se califica con destino institucional, aquellos predios destinados a la administracin y prestacin de servicios del Estado tanto de orden nacional como territorial.'),
	 (530,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,16,'Mineria_Hidrocarburos',NULL,0,'Minera hidrocarburos','Se califica con destino minera e hidrocarburos, aquellos predios donde se hace aprovechamiento directo de los recursos minerales o transformacin primaria de los mismos.'),
	 (531,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,17,'Lote_Urbanizable_No_Urbanizado',NULL,0,'Lote urbanizable no urbanizado','Se califica con este destino, aquellos predios urbanos no construidos, ubicados en terrenos de grandes reas que no han sido desarrollados y sin restriccin legal para adelantar algn tipo de desarrollo urbanstico.'),
	 (532,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,18,'Lote_Urbanizado_No_Construido',NULL,0,'Lote urbanizado no construido','Se califica con este destino, aquellos predios urbanos no construidos, ubicados en zonas urbanizadas, es decir, con infraestructura de servicios pblicos e infraestructura vial.'),
	 (533,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,19,'Lote_No_Urbanizable',NULL,0,'Lote no urbanizable','Se califica con este destino, aquellos predios urbanos o rurales clasificados por el instrumento de planeacin como suelo de proteccin, tambin se incluyen los predios con afectacin, por ejemplo los utilizados como servidumbres para los servicios pblicos.');
INSERT INTO test_ladm_col_queries.lc_destinacioneconomicatipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (534,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,20,'Pecuario',NULL,0,'Pecuario','Se califica con destino pecuario, aquellos predios destinados a la cra, beneficio y aprovechamiento de especies de animales no domsticos, para el consumo humano (productos crnicos y lcteos), uso artesanal (lana, cuero, plumas, etc.) y conservacin de fauna (zoocra).'),
	 (535,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,21,'Recreacional',NULL,0,'Recreacional','Se califica con destino recreacional, aquellos predios que corresponden a equipamientos deportivos y recreativos, parques de propiedad privada o pblica, clubes, generando bienestar fsico y social.'),
	 (536,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,22,'Religioso',NULL,0,'Religioso','Se califica con destino religioso, aquellos predios cuya finalidad es el culto religioso pblico, incluye las parroquias, baslicas, catedrales, santuarios, capillas, colegiatas, monasterios, conventos y seminarios.'),
	 (537,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,23,'Salubridad',NULL,0,'Salubridad','Se califica con destino salubridad, aquellos predios destinados al cuidado de la salud de los ciudadanos, incluye los hospitales, centros de salud, clnicas, laboratorios y consultorios que prestan el servicio de salud tanto carcter pblico o privado'),
	 (538,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,24,'Servicios_Funerarios',NULL,0,'Servicios funerarios','Se califica con destino infraestructura de servicios funerarios, aquellos predios que prestan servicios de velatorio, cremacin y entierro de personas fallecidas, incluye los cementerios, funerarias, morgue, anfiteatros, crematorios y dems relacionados.'),
	 (539,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DestinacionEconomicaTipo',NULL,25,'Uso_Publico',NULL,0,'Uso pblico','Se califica con destino uso pblico, aquellos predios urbanos o rurales, que conforman el espacio pblico, como las zonas verdes, alamedas, plazas (no se incluyen las plazas de mercado), plazoletas parques, cuerpos de agua, reas de control y proteccin ambiental, tneles, vas, ciclorutas, glorietas, etc.');INSERT INTO test_ladm_col_queries.lc_dominioconstrucciontipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (185,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DominioConstruccionTipo',NULL,0,'Comun',NULL,0,'Comn','Tipo de dominio comn.'),
	 (186,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_DominioConstruccionTipo',NULL,1,'Privado',NULL,0,'Privado','Tipo de dominio privado.');INSERT INTO test_ladm_col_queries.lc_estadoconservaciontipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (360,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_EstadoConservacionTipo',NULL,0,'Malo',NULL,0,'Malo','Se agrupan en este concepto, aquellas estructuras con el mayor grado de deterioro que se puedan encontrar, en condiciones precarias lo cual las hace prcticamente inhabitables.  Generalmente se presenta en construcciones antiguas o con material de muy mala calidad.'),
	 (361,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_EstadoConservacionTipo',NULL,1,'Regular',NULL,0,'Regular','En esta categora, se clasifican aquellas estructuras que tienen algunos daos menores, (agrietamiento de paredes, hundimiento de pisos, etc.) pero que todava se encuentran en condiciones aceptables, sin peligros eminentes o exigencias imperativa de reparaciones inmediatas.  Se presenta con frecuencia en construcciones ms o menos antiguas o materiales de regular calidad.'),
	 (362,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_EstadoConservacionTipo',NULL,2,'Bueno',NULL,0,'Bueno','Se calificarn como tales, aquellas estructuras, no necesariamente nuevas, que se hallan cumpliendo a cabalidad con la funcin para las que fueron construidas, no demuestran deterioro, al menos visibles, y por efectos de uso se encuentran solamente un tanto deslucidas y sus materiales son de buena calidad.'),
	 (363,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_EstadoConservacionTipo',NULL,3,'Excelente',NULL,0,'Excelente','Se define en este grado, el estado de conservacin de una estructura nueva en la que no se vislumbra deterioro, no se observa dao y en la cual los materiales y los acabados son de ptima calidad.');INSERT INTO test_ladm_col_queries.lc_estructuranovedadnumeropredial_tipo_novedad (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
