	 (354,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,0,'Cedula_Ciudadania',NULL,0,'Cdula de ciudadana','Es un documento emitido por la Registradura Nacional del Estado Civil para permitir la identificacin personal de los ciudadanos.'),
	 (355,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,1,'Cedula_Extranjeria',NULL,0,'Cdula de extranjera','Es el documento que cumple los fines de identificacin de los extranjeros en el territorio nacional y su utilizacin deber estar acorde con la visa otorgada al extranjero.'),
	 (356,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,2,'NIT',NULL,0,'NIT','El Nmero de Identificacin Tributaria (NIT) es un cdigo privado, secreto e intransferible que solamente debe conocer el contribuyente.'),
	 (357,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,3,'Tarjeta_Identidad',NULL,0,'Tarjeta de identidad','Es el documento oficial que hace las veces de identificacin para los menores de edad entre los 7 y los 18 aos.'),
	 (358,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,4,'Registro_Civil',NULL,0,'Registro civil','Registro donde se hacen constar por autoridades competentes los nacimientos, matrimonios, defunciones y dems hechos relativos al estado civil de las personas. En el modelo se tendr en cuenta el nmero de registro como identificacin personal de las personas de 0 a 7 aos.'),
	 (359,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,5,'Secuencial',NULL,0,'Secuencial','Es un consecutivo asignado automticamente en registro en lugar del nmero de la identificacin de la persona que hace el trmite, se usa especialmente en trmites de construccin cuando el proyecto est a nombre de una Fiducia el cual tiene el mismo nmero del banco.');INSERT INTO test_ladm_col_queries.lc_interesadotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (489,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoTipo',NULL,0,'Persona_Natural',NULL,0,'Persona natural','Se refiere a la persona humana.'),
	 (490,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoTipo',NULL,1,'Persona_Juridica',NULL,0,'Persona jurdica','Se llama persona jurdica, una persona ficticia, capaz de ejercer derechos y contraer obligaciones civiles, y de ser representada judicial y extrajudicialmente. Las personas jurdicas son de dos especies: corporaciones y fundaciones de beneficencia pblica.');INSERT INTO test_ladm_col_queries.lc_lindero (T_Id,T_Ili_Tid,longitud,geometria,localizacion_textual,comienzo_vida_util_version,fin_vida_util_version,espacio_de_nombres,local_id) VALUES
