	 (208,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,16,'Fachada.Pobre',NULL,0,'(Fachada) Pobre','-Puerta:  Fabricada con materiales como: Maderas burdas, lmina de zinc, lata o latones carecen por completo de lujos.

-Ventanas:  En la gran mayora de casos son pequeas, en madera burda o ngulo de hierro sencillo.

-Cubrimiento del muro:  Generalmente los muros no tienen cubrimiento, se presentan con ladrillo corrientes o bloque a la vista y en algunos casos pintura de cal o carburo directamente sobre el ladrillo, y en ocasiones paete sin pintar o con pinturas muy econmicas.'),
	 (209,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,17,'Fachada.Sencilla',NULL,0,'(Fachada) Sencilla','-Puerta:  En maderas sin trabajar o lminas metlicas sin ornamentacin

-Ventanas:  Pequeas o de regular tamao, en madera sin trabajo ornamental o metal con pintura de aceite.

-Cubrimiento de muros:  En la mayora de los casos se encuentran paetes con pinturas econmicas, o ladrillo prensado a la vista, generalmente un solo plano en el frente.'),
	 (210,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,18,'Fachada.Regular',NULL,0,'(Fachada) Regular','-Puerta de distintos tamaos, construidas en madera elaborada, o metal en lmina doblada, con rejas en ornamentacin metlica en la mayora de los casos.

-Cubrimiento:  Se encuentran frecuentemente paetados y enlucidos con pintura de regular calidad; en urbanizaciones se utiliza bastante el paete rstico pintado con cal o carburo.  Otras opciones son: En ladrillo prensado a la vista, el granito y la chapa de piedra de presentacin sencilla.  Hasta dos planos enfrente y con una longitud entre 7 y 8 mts, con antejardn, donde la puerta de garaje forma parte integral de esta fachada.'),
	 (211,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,19,'Fachada.Buena',NULL,0,'(Fachada) Buena','-Puertas en maderas con cierto trabajo manual; en algunos casos en lmina prensada (pintada en aceite o en muy pocos casos al duco) con metal ornamentado y vidrio martillado.

-Ventanas:  Amplias, en lmina prensada o madera trabajada, pintura de aceite.  Las ventanas ocupan buena parte del frente y la fachada.

-Cubrimiento:  Paete en cemento, pintura en vinilo, ladrillo prensado a la vista pintado en aceite, granito rstico fino pintado en vinilo, piedra pulida.

-La fachada presenta varios planos y tiene una longitud entre 10 y 14 mts, en el cual la puerta del garaje, en ocasiones doble, participa en forma importante.');
