	 (235,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,43,'Mobiliario_Banio.Pobre',NULL,0,'(Mobiliario de bao) Pobre','Cuenta con uno o mximo dos servicios entre lavamanos retrete y ducha; los porcelanizados, en caso de tenerlos, son muy econmicos; exceptuando los gabinetes pequeos de latn, no tiene ningn otro mobiliario ni divisiones.'),
	 (236,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,44,'Mobiliario_Banio.Sencillo',NULL,0,'(Mobiliario de bao) Sencillo','Esta categora de baos cuenta con tres servicios.  Los porcenalizados de esta categora son del tipo standard, se encuentran gabinetes muy sencillos y en latn y ocasionalmente pequeos armarios en madera burda o metal.'),
	 (237,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,45,'Mobiliario_Banio.Regular',NULL,0,'(Mobiliario de bao) Regular','Tiene mnimo tres servicios pero de tipo econmico.  Tienen gabinetes de regular tamao, algunas veces empotrados, lavamanos con mueble o pedestal y divisin de la ducha.'),
	 (238,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,46,'Mobiliario_Banio.Bueno',NULL,0,'(Mobiliario de bao) Bueno','Cuenta como mnimo con cuatro servicios, los porcenalizados son finos, en colores, con pedestales, adornos y grifera fina, tina, planchas de lavamanos generalmente en mrmol con muebles en madera trabajada de tamaos regulares a grandes, con espejos ms o menos grandes con luz integrada, la tina forma parte de la ducha, en el mismo espacio.

Tambin se encuentran pequeos armarios y gabinetes auxiliares en madera o acrlico, empotrados o sobrepuestos.  Normalmente presentan divisin de la ducha, construida en aluminio y cristalita.'),
