	 (5,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_RelacionPredioTipo',NULL,4,'Administrador',NULL,0,'Administrador','Indica si el administrador o alguna persona de su ncleo familiar fue el encargado de atender la visita predial.');INSERT INTO test_ladm_col_queries.lc_restriccion (T_Id,T_Ili_Tid,tipo,descripcion,interesado_lc_interesado,interesado_lc_agrupacioninteresados,unidad,comienzo_vida_util_version,fin_vida_util_version,espacio_de_nombres,local_id) VALUES
