	 (9,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,0,'Residencial.Apartamentos_4_y_mas_pisos_en_PH',NULL,0,'(Residencial) Apartamentos 4 y ms pisos en PH','Es una vivienda que comprende una o ms habitaciones, en un edificio de varios pisos 4 o ms pisos sometido en rgimen de propiedad horizontal.'),
	 (10,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,1,'Residencial.Apartamentos_En_Edificio_4_y_5_Pisos_Cartagena',NULL,0,'(Residencial) Apartamentos en Edificio de 4 y 5 Pisos (Cartagena)','Es una vivienda que comprende una o ms habitaciones, en un edificio de 4 o 5 pisos.'),
	 (11,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,2,'Residencial.Apartamentos_Mas_De_4_Pisos',NULL,0,'(Residencial) Apartamentos mas de 4 Pisos','Es una vivienda que comprende una o ms habitaciones, en un edificio de varios pisos 4 o ms pisos'),
