	 (13,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,4,'Residencial.Casa_Elbas',NULL,0,'(Residencial) Casa Elbas','Tpica casa con mampostera de piedra, pizarra y madera. Ha sido rehabilitada respetando escrupulosamente sus caractersticas exteriores y decorada con un interior tradicional'),
	 (14,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,5,'Residencial.Depositos_Lockers',NULL,0,'(Residencial) Depsitos o lockers','Edificacin destinada al almacenamiento o resguardo de enceres, generalmente ubicados en los stanos y semistanos de los edificios, junto a los parqueaderos. Las reas de estos depsitos generalmente no supera los 25 metros cuadrados.'),
	 (15,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,6,'Residencial.Garajes_Cubiertos',NULL,0,'(Residencial) Garajes Cubiertos','Es el lugar cubierto, destinado al estacionamiento privado de vehculos.'),
	 (16,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,7,'Residencial.Garajes_En_PH',NULL,0,'(Residencial) Garajes en PH','Es el lugar cubierto, destinado al estacionamiento privado o comunal en viviendas sometidas a rgimen de propiedad  horizontal.'),
	 (17,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,8,'Residencial.Salon_Comunal',NULL,0,'(Residencial) Saln comunal','Los salones comunales son dependencias que se construyen dentro de los edificios y conjuntos que sobrepasan un rea determinada de construccin, y se clasifican de acuerdo a las normas urbansticas como equipamiento comunal privado.'),
