	 (19,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,10,'Residencial.Vivienda_Colonial',NULL,0,'(Residencial) Vivienda Colonial','Son las viviendas construidas durante el tiempo de la colonia espaola, se caracterizan por tener varias habitaciones, con ventanales que dan a uno o dos patios generalmente ubicados en el centro de la vivienda. Los principales materiales de la poca era la tapia, bahareque, ladrillo, paja y teja.'),
	 (20,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,11,'Residencial.Vivienda_Hasta_3_Pisos',NULL,0,'(Residencial) Vivienda hasta 3 pisos','Es una casa de tres niveles cuya funcin arquitectnica y ambiental principal, es dar albergue en forma adecuada a una familia.'),
	 (21,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,12,'Residencial.Vivienda_Hasta_3_Pisos_En_PH',NULL,0,'(Residencial) Vivienda hasta 3 pisos en PH','Corresponde a edificaciones residenciales desarrolladas sobre un lote de terreno que comprende ms de tres unidades prediales independientes, generalmente en edificios de varios pisos. Este tipo de vivienda prev? reas de servicios comunales cuya propiedad y utilizacin privada se definen en reglamentos de propiedad horizontal'),
	 (22,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,13,'Residencial.Vivienda_Recreacional',NULL,0,'(Residencial) Vivienda Recreacional','Es una vivienda acondicionada para la realizacin de actividades recreativas libres y el descanso.'),
	 (23,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,14,'Residencial.Vivienda_Recreacional_En_PH',NULL,0,'(Residencial) Vivienda Recreacional en PH','Es una casa cuya funcin arquitectnica y ambiental principal, es brindar descanso y recreacin. Este tipo de vivienda  prev? reas de servicios comunales cuya propiedad y utilizacin privada se definen en reglamentos de propiedad horizontal.'),
	 (24,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,15,'Comercial.Bodegas_Comerciales_Grandes_Almacenes',NULL,0,'(Comercial) Bodegas Comerciales - Grandes Almacenes','Es el espacio construido para la ejecucin la recepcin, almacenamiento y movimientos de materiales, materias primas y productos semielaborados, hasta el punto de consumo por un cliente externo o interno'),
	 (25,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,16,'Comercial.Bodegas_Comerciales_en_PH',NULL,0,'(Comercial) Bodegas Comerciales en PH','Es el espacio construido para la ejecucin la recepcin, almacenamiento y movimientos de materiales, materias primas y productos semielaborados, hasta el punto de consumo por un cliente externo o interno sometido a rgimen de propiedad horizontal.'),
	 (26,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,17,'Comercial.Centros_Comerciales',NULL,0,'(Comercial) Centros Comerciales','es una construccin que consta de uno o varios edificios, por lo general de gran tamao, que albergan servicios, locales y oficinas comerciales aglutinados en un espacio determinado concentrando mayor cantidad de clientes potenciales dentro del recinto.'),
