	 (500,'Submodelo_Insumos_SNR_V1_0.SNR_ClasePredioRegistroTipo',NULL,0,'Rural',NULL,0,'Rural','Constituyen esta categora los terrenos no aptos para el uso urbano, por razones de oportunidad, o por su destinacin a usos agrcolas, ganaderos, forestales, de explotacin de recursos naturales y actividades anlogas. (Artculo 33, Ley 388 de 1997)'),
	 (501,'Submodelo_Insumos_SNR_V1_0.SNR_ClasePredioRegistroTipo',NULL,1,'Urbano',NULL,0,'Urbano','Constituyen el suelo urbano, las reas del territorio distrital o municipal destinadas a usos urbanos por el plan de ordenamiento, que cuenten con infraestructura vial y redes primarias de energa, acueducto y alcantarillado, posibilitndose su urbanizacin y edificacin, segn sea el caso. Podrn pertenecer a esta categora aquellas zonas con procesos de urbanizacin incompletos, comprendidos en reas consolidadas con edificacin, que se definan como reas de mejoramiento integral en los planes de ordenamiento territorial.

Las reas que conforman el suelo urbano sern delimitadas por permetros y podrn incluir los centros poblados de los corregimientos. En ningn caso el permetro urbano podr ser mayor que el denominado permetro de servicios pblicos o sanitario. (Artculo 31, Ley 388 de 1997)'),
