	 (138,'Submodelo_Insumos_SNR_V1_0.SNR_DocumentoTitularTipo',NULL,4,'Registro_Civil',NULL,0,'Registro civil','Registro donde se hacen constar por autoridades competentes los nacimientos, matrimonios, defunciones y dems hechos relativos al estado civil de las personas. En el modelo se tendr en cuenta el nmero de registro como identificacin personal de las personas de 0 a 7 aos.'),
