	 (140,'Submodelo_Insumos_SNR_V1_0.SNR_DocumentoTitularTipo',NULL,6,'Secuencial_SNR',NULL,0,'Secuencial SNR','Es un consecutivo asignado automticamente en registro en lugar del nmero de la identificacin de la persona que hace el trmite, se usa especialmente en trmites de construccin cuando el proyecto est a nombre de una Fiducia el cual tiene el mismo nmero del banco.');INSERT INTO test_ladm_col_queries.snr_fuentetipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
