	 (142,'Submodelo_Insumos_SNR_V1_0.SNR_FuenteTipo',NULL,1,'Escritura_Publica',NULL,0,'Escritura pblica','Una escritura pblica es un documento pblico en el que se realiza ante un notario pblico un determinado hecho o un derecho autorizado por dicho fedatario pblico, que firma con el otorgante u otorgantes,mostrando sobre la capacidad jurdica del contenido y de la fecha en que se realiz'),
	 (143,'Submodelo_Insumos_SNR_V1_0.SNR_FuenteTipo',NULL,2,'Sentencia_Judicial',NULL,0,'Sentencia judicial','La sentencia es la resolucin judicial definitiva dictada por un juez o tribunal que pone fin a la litis o caso sometido a su conocimiento y cierra definitivamente su actuacin en el mismo'),
