CONTRACTED MODEL Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1 (es)
AT "http://www.proadmintierra.info/"
VERSION "V2.2.1"  // 2018-02-19 // =
  IMPORTS ISO19107_PLANAS_V3_0,LADM_COL_V3_0,Submodelo_Integracion_Insumos_V1_0;

  DOMAIN

    /** Valores para indicar el nivel de acuerdo
     */
    LC_AcuerdoTipo = (
      /** Existe un acuerdo sobre la posicin del punto
       */
      !!@ ili2db.dispName = "Acuerdo"
      Acuerdo,
      /** Existe un desacuerdo sobre la posicin del punto
       */
      !!@ ili2db.dispName = "Desacuerdo"
      Desacuerdo
    );

    LC_AnexoTipo = (
      !!@ ili2db.dispName = "Enramadas o cobertizos o caneyes"
      Enramadas_Cobertizos_Caneyes(
        /** Locales de venta de vehculos: Estructura concreto, cubierta cercha metlica y teja canaleta; fachada vidrio y polarizado, piso baldosn conservacin general buena.
         */
        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 90"
        Tipo_90,
        /** Estructura metlica; cubierta de zinc, eternit o teja de barro, pisos de cemento, conservacin general buena.
         */
        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 80"
        Tipo_80,
        /** Estructura en madera fina; cubierta de zinc, eternit o teja de barro pisos de cemento; conservacin general buena a regular.
         */
        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 60"
        Tipo_60,
        /** Estructura en madera comn; cubierta de zinc, eternit o teja de barro; pisos en tierra; conservacin regular a mala.
         */
        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 40"
        Tipo_40
      ),
      !!@ ili2db.dispName = "Galpones o gallineros"
      Galpones_Gallineros(
        /** Estructura metlica o madera fina, cubierta de zinc, eternit o teja de barro; muros a mediana altura en bloque o ladrillo; pisos de cemento; conservacin general buena.
         */
        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 80"
        Tipo_80,
        /** Estructura ladrillo o bloque; cubierta de zinc, eternit o teja de barro semi muros en bloque o ladrillo; pisos de cemento; conservacin general buena a regular.
         */
        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 60"
        Tipo_60,
        /** Estructura en ladrillo, bloque o madera sencilla; cubierta de zinc, eternit o teja de barro; con o sin muros; pisos en tierra; conservacin regular a mala.
         */
        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 40"
        Tipo_40,
        /** Estructura en madera; cubierta de zinc, eternit, teja de barro, paja o material de desecho; con o sin muros; pisos en tierra; conservacin regular o mala.
         */
        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 20"
        Tipo_20
      ),
      !!@ ili2db.dispName = "Establos o pesebreras"
      Establos_Pesebreras(
        /** Estructura metlica o de concreto; cubierta de zinc, eternit a teja de barro muros en bloque o ladrillo, pisos de cemento, conservacin en general buena.
         */
