    LC_CategoriaSueloTipo = (
      /** Constituyen esta categora las reas ubicadas dentro del suelo rural, en las que se mezclan los usos del suelo y las formas de vida del campo y la ciudad, diferentes a las clasificadas como reas de expansin urbana, que pueden ser objeto de desarrollo con restricciones de uso, de intensidad y de densidad, garantizando el autoabastecimiento en servicios pblicos domiciliarios, de conformidad con lo establecido en la Ley 99 de 1993 y en la Ley 142 de 1994. Podrn formar parte de esta categora los suelos correspondientes a los corredores urbanos interregionales.
